import {useSelector} from "react-redux";

const Profile = () =>{
    const user = useSelector((state)=>state.user.value)
    const color = useSelector((state)=> state.color.value)
    return(
        <div>
            <h1 color={color}>Profile Page</h1>
            <p>Name:{user.name}</p>
            <p>Age:{user.age}</p>
            <p>Email:{user.email}</p>

        </div>
    )
}
export default Profile
